import React from 'react'
import { connect } from 'react-redux'

const UserListing = (props) => {
    console.log(props.users);
    return (
        <table>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                </tr>
            </thead>
            <tbody>
                {
                    props.users.map((user) => 
                        <tr key={user.name}>
                            <td>{user.name}</td>
                            <td>{user.email}</td>
                        </tr>
                    )
                }
            </tbody>
        </table>
    )
}

const mapStateToProps = (state) => {
    return {
        users: state.users
    }
}

export default connect(mapStateToProps)(UserListing)
